import { ActionTypes } from "../constants/action-types";


//create state
const initialState = {
    profiles: [
        {
        id: 1,
        name: "Jigyashu Nager",
        username: "Jigyashu",

        },
        {
        id: 2,
        name: "Jig Nager",
        username: "Jig",
        },
        {
        id: 3,
        name: "Ji Nager",
        username: "Ji",

        },
    ],
};

export const profileReducer = (state = initialState, {type, payload}) => {
    switch (type) {
        case ActionTypes.SET_PROFILES:
            return state;

        default:
            return state;
    }
}
